
def minDistance(word1, word2):
    l1 = len(word1)
    l2 = len(word2)
    dp = [[0 for i in range(l1+1)] for  i in range(l2+1)]
    for i in range(l1+1):
        dp[0][i] = i
    for j in range(l2+1):
        dp[j][0] = j
    for i in range(l2):
        for j in range(l1):
            cost = 0
            if word2[i] != word1[j]:
                cost = 1
            dp[i+1][j+1] = min(dp[i][j] + cost,min(dp[i][j+1] + 1,dp[i+1][j] + 1))
    return dp[l2][l1]
